import React, { Component } from "react";
export class DataSearch extends Component {
  render() {
    return (
      <div>
      <label>Search</label>
        <input
          type="text"
          name="query"
          value={this.props.query}
          onChange={this.handleChange}
        />
      </div>
    );
  }
}

export default DataSearch;
